import './App.css';
import Navbar from './Components/Navbar/Navbar';
import{BrwoserRouter,Routes,Route}from 'react-router-dom';
import Shop from './Pages/Shop';




function App() {
  return (
    <div className="App">
      <Navbar />
      <BrwoserRouter>
      <Navbar/>
      <Routes>
        <Route path='/' element={<Shop/>}/>
      </Routes>
      </BrwoserRouter>
    </div>
  );
}
Route
export default App;
